public void calcTotalsDebt(Query       _query)
{
    CustOverdueVATDebtJournalLine_W totalDebtLines;
    Query                           query = new Query(_query);
    QueryRun                        queryRun;
    QueryBuildDataSource            qbds;

    qbds        = query.dataSourceTable(tablenum(CustOverdueVATDebtJournalLine_W));
    qbds.addSelectionField(fieldnum(CustOverdueVATDebtJournalLine_W, OverdueAmountMST), SelectionField::Sum);
    qbds.addSelectionField(fieldnum(CustOverdueVATDebtJournalLine_W, OverdueTaxAmountMST), SelectionField::Sum);

    query.clearGroupBy();

    queryRun    = new QueryRun(query);
    queryRun.next();
    totalDebtLines  = queryRun.get(tablenum(CustOverdueVATDebtJournalLine_W));

    totalDebtOverdueAmountMST       = abs(totalDebtLines.OverdueAmountMST);
    totalDebtOverdueTaxAmountMST    = abs(totalDebtLines.OverdueTaxAmountMST);
}

