        query = new Query(this.queryRun().query());
    }
    else
    {
        query = new Query(this.query());
    }

    qbdsDebt        = query.dataSourceTable(tableNum(CustOverdueVATDebtJournalLine_W));
    qbdsTrans       = query.dataSourceTable(tableNum(CustTrans));
    qbdsTable       = query.dataSourceTable(tableNum(CustTable));
