        qbdsDirParty.addGroupByField(fieldNum(DirPartyTable, Name));
    }
    else
    {
        query.clearGroupBy();
        qbdsDebt.fields().clearFieldList();
    }

    switch (element.args().dataset())
    {
        case tableNum(CustOverdueVATJournalTable_W):
            custOverdueVATJournalTable = element.args().record();
            findOrCreateRange_W(qbdsDebt, fieldNum(CustOverdueVATDebtJournalLine_W, JournalId), custOverdueVATJournalTable.JournalId);
            break;

        case tableNum(CustOverdueVATTurnJournalLine_W):
            custOverdueVATTurnJournalLine = element.args().record();

            findOrCreateRange_W(qbdsDebt, fieldNum(CustOverdueVATDebtJournalLine_W, JournalId), custOverdueVATTurnJournalLine.JournalId);
            findOrCreateRange_W(qbdsDebt, fieldNum(CustOverdueVATDebtJournalLine_W, SettingRecId), queryValue(custOverdueVATTurnJournalLine.SettingRecId));
